ul.tileList li.tile .title {font-family: "Century Gothic", "schoolbox", "Helvetica Neue", "Open Sans", Helvetica, "Droid Sans", Arial, sans-serif;}

.left-off-canvas-menu .logo-wrapper .logo {padding: 1.1rem 0;}



/* Shadow on left menu */

.left-off-canvas-menu {

-webkit-box-shadow: 10px 0px 75px -30px rgba(0,0,0,0.75);

-moz-box-shadow: 10px 0px 75px -30px rgba(0,0,0,0.75);

box-shadow: 10px 0px 75px -30px rgba(0,0,0,0.75);

}



/* Temp fix */

.dz-preview .dz-progress, .dropzone-previews .dz-preview .dz-progress {

position: unset;

}



/*Search Font Size */

.hybrid-bar #search input[type="text"] {font-size: 1rem;}



/* Heading Text Styles */

component-titlebar {text-transform:uppercase;}

h1{ font-weight: 100;color: rgb(42, 104, 143);text-transform: uppercase;text-align:center;}



/*Header Background */

#hybrid-bar {background : #2a688f url('https://olle.tigs.nsw.edu.au/header.png') repeat center;}

.tab-bar {background:inherit;}



/* Calendar Fixes */

.fc .fc-today {

    background: #b4e0ff !important;

